export async function getProducts() {
  const response = await fetch(`https://panda-market-api.vercel.app/Products`);
  const body = await response.json();
  const product = body.list.map((items) => ({
    id: items.id,
    title: items.name,
    description: items.description,
    price: items.price,
    image: items.images,
    favoriteCount: items.favoriteCount,
    createAt: items.createAt,
  }));
  return product;
}
